import React from 'react'
import { AbstractCar } from './AbstractCar'
import { AbstractDoor, AbstractEngine, AbstractLight, AbstractRims, AbstractTire, AbstractWindow } from './AbstractCar.types'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCar, faDoorOpen, faPersonThroughWindow } from '@fortawesome/free-solid-svg-icons'

type AbstractCarProps = {
    engine: AbstractEngine[],
    doors: AbstractDoor[],
    windows: AbstractWindow[],
    tires: AbstractTire[],
    rims: AbstractRims[],
}
const NormalCar = (props: AbstractCarProps) => {
    return (
        <div>
            <div className='header'>
                <h1>Stel je Auto samen:</h1>
            </div>
            <div className='sub-header'>
            <h2>Klik op de eigenschappen om ze te kiezen</h2>
            </div>
            {
                props.engine.map(car => {
                    return (
                        <div>
                            <div className='option-container'>
                        <h2><FontAwesomeIcon icon={faCar} /> Moter:<br></br> </h2>
                        <h3 key={car.id}> {car.EngineType}</h3>
                        </div>
                        </div>
                    )
                })
            }
            {
                props.doors.map(door => {
                    return (
                        <div>
                             <div className='option-container'>
                                <h2><FontAwesomeIcon icon={faDoorOpen} /> Kleur deuren:<br></br> </h2>
                        <h3 key={door.id}>{door.color}</h3>
                        </div>
                        </div>
                    )
                })
            }
            {
                props.windows.map(window => {
                    return (
                        <div>
                            <div className='option-container'>
                        <h2><FontAwesomeIcon icon={faPersonThroughWindow} />Kleur ramen:</h2>
                        <h3 key={window.id}>{window.color}</h3>
                        </div>
                        </div>
                    )
                })
            }
            {

            }
            </div>
    )
}

export default NormalCar
